post_text:
The California Parent and Youth Helpline provides support and resource referrals to parents and youth during the current COVID-19 pandemic, seven days per week from 8:00 a.m. until 8:00 p.m. Call or text 1-855-4APARENT (855-427-2736) for services in English, Spanish, and other languages. For more information, please visit https://caparentyouthhelpline.org.

