post_text:
Fresno Pacific University’s Visual and Performing Arts Division invites Tulare County theater students to a special Zoom meeting on Tuesday, April 21 at 12:40 p.m. Don Darryl Rivera from Disney’s Aladdin on Broadway will be discussing his career and answering questions. Mr. Rivera originated the role of Iago in the Broadway production and is still playing it seven years later!

To join Fresno Pacific's Zoom meeting with Don Darryl Rivera, visit https://fresno.zoom.us/j/460921218

@DonDarrylRivera

